s responsable del precio final y las condiciones de compra. ","textColor":4279440147},{"text":"Más información","navigationEndpoint":{"clickTrackingParams":"CHUQx1UiEwjOnb_hjaaAAxWGnJkKHYW-AQg=","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}},{"text":"\n\nYouTube no se responsabiliza de los productos de los comercios ni de la información que ellos entregan. YouTube no es responsable de las actividades y compras realizadas a comercios (incluidas aquellas que se hagan a través de los vínculos que aparecen a continuación), que se rigen por los términos y condiciones de los comercios (incluidas sus políticas de privacidad). Las opiniones sobre productos están disponibles solo en ubicaciones seleccionadas y Google no las verifica. ","textColor":4279440147},{"text":"Más información","navigationEndpoint":{"clickTrackingParams":"CHUQx1UiEwjOnb_hjaaAAxWGnJkKHYW-AQg=","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/googleshopping/answer/9370999?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/googleshopping/answer/9370999?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}}]},"confirmLabel":{"simpleText":"Aceptar"},"trackingParams":"CHUQx1UiEwjOnb_hjaaAAxWGnJkKHYW-AQg="}},"popupType":"DIALOG"}},"trackingParams":"CDcQw9AHGAAiEwjOnb_hjaaAAxWGnJkKHYW-AQg="}},{"menuServiceItemRenderer":{"text":{"accessibility":{"accessibilityData":{"label":"Denunciar una ficha"}},"simpleText":"Denunciar una ficha"},"icon":{"iconType":"FLAG"},"serviceEndpoint":{"clickTrackingParams":"CHQQ1tgHGCMiEwjOnb_hjaaAAxWGnJkKHYW-AQg=","commandMetadata":{"webCommandMetadata":{"sendPost":true,"apiUrl":"/youtubei/v1/flag/get_form"}},"getReportFormEndpoint":{"params":"ygEIc2hvcHBpbmfQAQ7iAd0rC
